import React from "react"
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import Forms from "./forms"

function App(){

    const Goto = function (){
        return(
            <Switch>
                <Route path='/forms' component = {Forms} />
            </Switch>
        )
    }
    return(
        <div>
            <button onClick={Goto}>Enter the Data</button>
        </div>
    )
}

export default App
